import React, { useContext } from 'react'
import Modal from './../Modal/Modal'
import { UserContext } from './../context/UserContext' // Make sure path is correct
import Cart from '../UI/Cart'

export default function OrderCartModal() {
  const { isOpen,setIsOpen } = useContext(UserContext)

  return (
    <Modal>
      <Cart className="bg-white p-6 rounded shadow-lg">
        <h2 className="text-xl font-bold mb-4">This is Modal</h2>
        <button
          onClick={() => setIsOpen(false)}
          className="bg-red-500 text-white px-4 py-2 rounded"
        >
          Close
        </button>
      </Cart>
    </Modal>
  )
}
